import MainLAyout from '../components/Mainlayout'

export default function Home() {
  return (
    <MainLAyout>
      <Head>
        
      </Head>

      <main >
      <div class="homeContainer">
        <div className="bookingDetails">
            <div className="bookingDetail">
                <div class="bookingLabel">
                    <label for="text-input" class="labelText">Text</label>
                </div>

                <div class="bookingForm">
                    <input class="form-control" type="text" id="text-input"/>
                </div>
            </div>
            <div className="bookingDetail">
                <div class="bookingLabel">
                    <label for="text-input" class="labelText">Text</label>
                </div>

                <div class="bookingForm">
                    <input class="form-control" type="text" id="text-input"/>
                </div>
            </div>
            <div className="bookingDetail">
                <div class="bookingLabel">
                    <label for="text-input" class="labelText">Text</label>
                </div>

                <div class="bookingForm">
                    <input class="form-control" type="text" id="text-input"/>
                </div>
            </div>
            <div className="bookingDetail">
                <div class="bookingLabel">
                    <label for="text-input" class="labelText">Text</label>
                </div>

                <div class="bookingForm">
                    <input class="form-control" type="text" id="text-input"/>
                </div>
            </div>
            <div className="bookingDetail">
                <div class="bookingLabel">
                    <label for="text-input" class="labelText">Text</label>
                </div>

                <div class="bookingForm">
                    <input class="form-control" type="text" id="text-input"/>
                </div>
            </div>
            
        </div>
        </div>
    
      </main>

      

      <style jsx>{`
       
       .bookingDetails{
           background-color:#f1f1f1;
           display:flex;
           justify-content:space-between;
           margin:1rem;
           width:100%;
       }
        @media screen and (max-width: 700px){
        .bookingDetails{
            
          margin:5px 0px;
        }
        }
       .bookingDetail{
           margin-left:10px;
           padding:30px 10px;
           
           display:flex;
           flex-direction:column;
       }
       .bookingLabel{
            margin-left:10px;
            border-bottom:1px solid black;
       }
       .labelText{
           color:blue;   
       }

      `}</style>
    </MainLAyout>
  )
}
